	local function listaPericiasSendAtr(roll1, roll2)
			
		if sheet.medieval == true and roll1 > 80 then 	
			roll2 = toint((roll2 + 1)/2 );
		end;
		
		if roll1 > 20 then 	
			if roll1 > 40 then 
				if roll1 > 60 then 
					if roll1 > 80 then 
						
						return "DES";	
						
						
						
					else 
						if roll2 > 10 then
							return "CAR";
						else
							return "PER";
						end;
					end;
				else 
					if roll2 > 10 then
						return "FDV";
					else
						return "INT";
					end;
				end;
			else 
				if roll2 > 10 then
					return "AGI";
				else
					return "DES";
				end;
