	 --alterar dinheiro
	local function AlterarDinheiro(DinheiroAlterar, DinheiroLugar, operacao, Lugar)
		if sheet.NOMEdoPERSONAGEM == nil then sheet.NOMEdoPERSONAGEM = "0";end;
		if DinheiroAlterar == nil then
			DinheiroAlterar = 0;
			else
				if DinheiroLugar == nil then
					DinheiroAlterar = 0;
				end;
		end;
		
	
	
		if DinheiroAlterar < 0 then
			DinheiroAlterar = DinheiroAlterar*(-1);
		end;
		
		local chat = rrpg.getMesaDe(sheet).chat;
		
		if operacao == "+" then
		
			DinheiroLugar = DinheiroLugar + DinheiroAlterar ;
			chat:enviarMensagem(sheet.NOMEdoPERSONAGEM .. " aumentou $" .. DinheiroAlterar .. " do(a) " .. Lugar );
			
		else
		
			DinheiroLugar = DinheiroLugar - DinheiroAlterar ;
			chat:enviarMensagem(sheet.NOMEdoPERSONAGEM .. " diminuiu $" .. DinheiroAlterar .. " do(a) " .. Lugar );
		
		end;
		
		
		
		
		return DinheiroLugar;
		
		
	end;
	
