	--testar habilidade
	local function TestePorcentagem(porcentagem , dificuldade, atributo)
		if sheet.NOMEdoPERSONAGEM == nil then sheet.NOMEdoPERSONAGEM = "0";end;
		if atributo == nil then atributo = "---"; end;
	
		local roll = rrpg.interpretarRolagem("1d100");
		roll:rolarLocalmente();
		
		
		local chat = rrpg.getMesaDe(sheet).chat;
		chat:enviarMensagem(sheet.NOMEdoPERSONAGEM .. ": Teste " .. dificuldade .. " de " .. atributo .. " com " .. porcentagem .. "% de chance de sucesso."  );
		
		
		
		
		if roll.resultado <= porcentagem then 
			--sucesso	
			if roll.resultado <= 5 then
				chat:enviarMensagem("Resultado: " .. roll.resultado .. ", SUCESSO CRÍTICO!!!" );
			else
				chat:enviarMensagem("Resultado: " .. roll.resultado .. ", SUCESSO!" );
			end;
			
		
		
		else
			--falha
			if roll.resultado >= 95 then
				chat:enviarMensagem("Resultado: " .. roll.resultado .. ", FALHA CRÍTICA!!!" );
			else
				chat:enviarMensagem("Resultado: " .. roll.resultado .. ", FALHA!" );
			end;
		
		
		end;
		
		return ;

	
		
		
	end;
	
		-- barra para atributos de 9 a 13
	local function CALCULARbarra9to13(atributo,numero)
				--outros atributos
				
			--iniciativa
			if numero == 9 then 
				atributo  = atributo * (atributo/50 + 0.5);
				return toint((atributo / (atributo +50)) *100 );
			end;
			
			--velocidade
			if numero == 10 then 
				atributo  = 15*(atributo * (atributo/50 + 0.5));
				return toint((atributo / (atributo +50)) *100 );
			end;		
			
			--cansaço
			if numero == 11 then 
				atributo  = 4*(atributo * (atributo/50 + 0.5));
				return toint((atributo / (atributo +50)) *100 );
			end;			
			
			--pontos de vida
			if numero == 12 then 
				atributo  = 6*(atributo * (atributo/50 + 0.5));
				return toint((atributo / (atributo +50)) *100 );
			end;			
			
			--pontos de magia
			if numero == 13 then 
				atributo  = 10*(atributo * (atributo/50 + 0.5));
				return toint((atributo / (atributo +50)) *100 );
			end;
		
	end;
	
	--calcula a % dos testes e das barras
	local function Testes(Atributo, dificuldade)
		if Atributo == nil then
			Atributo = 0;
		end;
		
		
		--se normal
		if dificuldade == "M" then
		Atributo = Atributo;
		end;
		--outras dificuldades
		if dificuldade == "F" then
		Atributo = Atributo*2;
		end;
		if dificuldade == "MF" then
		Atributo = Atributo*4;
		end;
		if dificuldade == "D" then
		Atributo = Atributo/2;
		end;
		if dificuldade == "MD" then
		Atributo = Atributo/4;
		end; 
		--se for para as barras, configurando a barra para ser mais sensivel na variação
		if dificuldade == "B" then
			Atributo = Atributo* (Atributo/50 + 0.5);
		end; 
		
		--CALCULANDO
		local x = toint((Atributo / (Atributo +50)) *100 );
		
		
		-- testes para 95% e 5%
		if dificuldade ~= "B" then
			if x > 95 then
				x = 95
			end;
			if x < 5 then
				x = 5
			end;
		
		end;
		
		return x;
		
	end;
	
	
	
	--botão que muda o tipo de atributo que a perícia eh baseada
	local 	function MudarAtributodaPericia(Atributo)
		
			if Atributo == "CON" then
				
				return "FOR";
			else
				if Atributo == "FOR" then
				
					return "DES";
				else
					if Atributo == "DES" then
						
						return "AGI";
					else
						if Atributo == "AGI" then
							
							return "INT";
						else
							if Atributo == "INT" then
								
								return "FDV";
							else
								if Atributo == "FDV" then
									
									return "PER";
								else
									if Atributo == "PER" then
										
										return "CAR";
									else
										if Atributo == "CAR" then
											
											return "CON";
										else
											return;
										end;
									end;	
								end;
							end;
						end;
					end;	
				end;
			end;
			
		
		
		return;
		
		end;
	
