    obj.textEditor129:setText("    1)Na aba Ficha, clique em CRIAR PERSONAGEM. Escolha medieval se quiser que seja medieval. Preencha o Nome do Personagem e o Nome do Jogador.\n\n    2)-OPCIONAL- Na aba de Raças e Classes, leia o texto e use a Raça e a Classe. O mestre deve autorizar utilizar essa característica.\n\n    3)Na aba Traços e Magias, descreva-os usando a imaginação.\n-Para Traços: +5 é excelente,+1 é um pouco bom, -1 é um pouco ruim e -5 é algo horrível\n-Para Magias: 1PM é uma magia fraca, 5PM é extremamente forte. Para exemplos veja a aba de Exemplos.\n\n    4)Faça a história do personagem. Tente se basear ao máximo nos seus Traços/Perícias/Magias/Raça/Classe/História.\n\n     5)-OPCIONAL- Na aba Itens e Equipamentos, compre os itens da Tabela de itens ou de outra tabela dada pelo mestre.\n\n     6)Preencha a aba de Batalha com as armas/danos e as defesas. Coloque a Aparência e uma foto baseado na sua altura, peso, idade e sexo/visual na aba Ficha.\n\n    7)Boa sorte no jogo!!!");
    obj.textEditor129:setName("textEditor129");

