    obj.textEditor130 = gui.fromHandle(_obj_newObject("textEditor"));
    obj.textEditor130:setParent(obj.tab30);
    obj.textEditor130:setFontSize(20);
    obj.textEditor130:setReadOnly(true);
    obj.textEditor130:setFontColor("black");
    obj.textEditor130:setTransparent(true);
    obj.textEditor130:setLeft(5);
    obj.textEditor130:setTop(100);
    obj.textEditor130:setWidth(490);
    obj.textEditor130:setHeight(600);
    obj.textEditor130:setText("    TRAÇOS:\n    Os Pts de Traços variam de -5 a +5. Esses números medem a intensidade.\nExemplo: Mudo -1 pode ser um mudo que só fica mudo quando está com medo, enquanto Fobia -5 é muito grave, podendo ser mudo sempre!\n\n    MAGIAS:\n    -Recomenda-se limitar as magias e adaptar ao seu sistema. Sugiro a seguinte escala para cada PM que custa uma magia:\n    Dano: 1d6 , Distância: 20m, Velocidade: 10m/s, Proteção: 1Abs., Duração: 1d6 turnos.\n    Exemplo1: Uma magia que usa 5PM é muito mais forte que uma que usa somente 1PM\n    Exemplo2: Bola de fogo custa 3PM logo dará um dano de 3d6, já Bola de fogo fraca custa 2PM e logo dará 2d6 de dano.\n    Exemplo3: A magia de parar o tempo custa 5PM. Imagine parar o tempo por 5d6 turnos, seria muita coisa! O mestre pode limitar para 3 turnos de duração e só poderá usar 1 vez por semana a magia. Use a imaginação.    ");
    obj.textEditor130:setName("textEditor130");

    obj.textEditor131 = gui.fromHandle(_obj_newObject("textEditor"));
    obj.textEditor131:setParent(obj.tab30);
    obj.textEditor131:setFontSize(20);
    obj.textEditor131:setReadOnly(true);
    obj.textEditor131:setFontColor("black");
    obj.textEditor131:setTransparent(true);
    obj.textEditor131:setLeft(505);
    obj.textEditor131:setTop(100);
    obj.textEditor131:setWidth(490);
    obj.textEditor131:setHeight(600);
    obj.textEditor131:setText("    Serão necessárias 2 fichas de personagens para a batalha acontecer, pois será preciso saber o local em que o golpe foi acertado. DICA:NPCs são feitos rapidamente.\n\n    1)Ataca primeiro quem tem maior iniciativa INI.\n\n    2)O atacante usa a aba Batalhas e clica no botão de % correspondente à arma utilizada e à dificuldade definida pelo mestre. Será dado o resultado; caso acerte, será dado o lugar de acerto.\n\n    3)Caso o jogador acerte, o NPC deve jogar a sua defesa.\n\n    4)Caso evada, não leva dano. Caso use o escudo com sucesso, soma-se a proteção do escudo com a proteção da área afetada.\n\n    5)O atacante rola o dado de dano na aba de Batalhas. Selecione crítico se foi dada a mensagem de sucesso crítico. Adicione o dano da FOR se for arma corpo a corpo.\n\n    6)Agora é só subtrair a proteção do dano total na área acertada e subtrair novamente dos PVs.\n\n    7)Nesse momento outro ataca e o processo é repetido.");
    obj.textEditor131:setName("textEditor131");

