    obj.textEditor132:setHeight(600);
    obj.textEditor132:setText("    -Use e abuse desta ferramenta para fazer NPCs facilmente. Caso queira algo diferenciado, como um dragão com 5000 de FOR, mude a coluna MOD depois de criado.\n\n    -O mestre pode e deve inutilizar ou adaptar os Traços/Magias que forem incompatíveis com a aventura.\n\n    -Traços e Magias podem ser ganhos ao longo do jogo.\n\n    -Existem atributos que não foram explicados , use e adapte em seu sistema.\n\n    Use XP e Level como você quiser. É só pesquisar na internet você verá inúmeras maneiras, mas aqui vai uma sugestão:\n 10xp por hora jogada para cada jogador.\n Pode-se adicionar xp por interpretação, inimigos mortos e missões.\n Sobe-se de level quando atingir 100xp. Todos os leveis se sobem com 100xp.\n\n    -Se ganha upando:\n    1) 5pts para distribuir entre: CON,FOR,DES,AGI,INT,FDV,PER ou CAR.\n    2) 1pt para distribuir entre: PV ou PM.\n    3) 1pt para distribuir entre: INI e CAN\n    4) +20pts para distribuir em perícias.\n    ");
    obj.textEditor132:setName("textEditor132");

    obj.textEditor133 = gui.fromHandle(_obj_newObject("textEditor"));
    obj.textEditor133:setParent(obj.tab31);
    obj.textEditor133:setFontSize(20);
    obj.textEditor133:setReadOnly(true);
    obj.textEditor133:setFontColor("black");
    obj.textEditor133:setTransparent(true);
    obj.textEditor133:setLeft(505);
    obj.textEditor133:setTop(100);
    obj.textEditor133:setWidth(490);
    obj.textEditor133:setHeight(600);
    obj.textEditor133:setText("    -Os personagens têm 50% de chance de serem feitos com magias.\n\n    -Chances de acerto: torso 30%, cabeça 10%, cada braço e perna 10%, cada mão e pé 5%.\n\n    -Mudar um atributo não irá afetar em outros atributos. Ex: Mudar CON ou AGI não afetará PV ou VEL. Porém irão mudar as perícias. Caso queira acompanhar, poderá mudar manualmente na coluna MOD do próprio atributo. \n\n    -Sim, peso e massa são diferentes, usei de modo coloquial para um melhor entendimento de todos. Calor e frio também seguem esta regra.");
    obj.textEditor133:setName("textEditor133");

